[Form]
public final class CustRORReturnNoteJournal extends FormRun
{
    InventDimCtrl_Frm_Mov   inventDimFormSetup;
    ShipCarrierPackage      tmpShipCarrierPackage;
    Map                     isDropShipmentMap;
    boolean                 refreshCaller;
}

public void close()
{
    FormDataSource      formDataSource;

    super();

    if (refreshCaller
    &&  FormDataUtil::isFormDataSource(element.args().record()))
    {
        formDataSource = FormDataUtil::getFormDataSource(element.args().record());
        formDataSource.research(true);
    }
}

public Common docCursor()
{
    Common docCursor;

    docCursor = super();

    if (docCursor.TableId == tableNum(InventDim))
    {
        docCursor = CustRORReturnNoteTrans;
    }

    return docCursor;
}

void init()
{
    #WinAPI;

    super();

    if (element.args().record())
    {
        CustRORReturnNoteJour_ds.object(fieldNum(CustRORReturnNoteJour, InvoiceAccount)).visible(false);
    }

    element.updateDesign(InventDimFormDesignUpdate::Init);

    // To avoid run-time error during call to setTmp() method on DS tables disabled by ShipCarrier config key
    // figure out if this configuration key is disabled and avoid calls to DS tables' setTmp() method.
    boolean shippingCarrierConfigKeyEnabled = isConfigurationkeyEnabled(configurationKeyNum(ShipCarrier));

    if (shippingCarrierConfigKeyEnabled)
    {
        //BP Deviation documented
        shipCarrierTracking.setTmp();

        //BP Deviation documented
        shipCarrierPackage.setTmp();

        //BP Deviation documented
        tmpShipCarrierPackage.setTmp();
    }

    isDropShipmentMap = new Map(typeName2Type(extendedTypeStr(RecId)), Types::Enum);
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    SalesLine       salesLine;
    InventMovement  movement = InventMovement::construct(salesLine);

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup = InventDimCtrl_Frm_Mov::newFromFormMovement(element, movement);
            }

        case InventDimFormDesignUpdate::Active :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(false);
            break;

        default : throw error(strFmt("@SYS54195", funcName()));
    }
}

private boolean isDropShipment()
{
    boolean isDropShipment;

    if (isDropShipmentMap.exists(CustRORReturnNoteJour.RecId))
    {
        isDropShipment = isDropShipmentMap.lookup(CustRORReturnNoteJour.RecId);
    }
    else
    {
        isDropShipment = CustRORReturnNoteJour.isDropShipment();
        isDropShipmentMap.insert(CustRORReturnNoteJour.RecId, isDropShipment);
    }

    return isDropShipment;
}

public int active()
{
    int     ret;
    boolean isDropShipment;

    ret = super();

    isDropShipment = this.isDropShipment();
    buttonHeaderVendPackingSlipJournal.enabled(isDropShipment);
    buttonLineVendPackingSlipJournal.enabled(isDropShipment);
    RORReturnNoteCancel.enabled(CustRORReturnNoteJour.SalesType != SalesType::RORRental && !CustRORReturnNoteJour.isCanceled());

    return ret;
}

public void init()
{
    QueryBuildDataSource  queryDataSourceLink;

    super();

    if (element.args().dataset() == tableNum(SalesTable))
    {
        this.query().dataSourceTable(tableNum(CustRORReturnNoteJour)).clearDynalinks();

        queryDataSourceLink = this.query().dataSourceTable(tableNum(CustRORReturnNoteJour)).addDataSource(tableNum(CustRORReturnNoteSalesLink));
        queryDataSourceLink.relations(true);
        queryDataSourceLink.addDynalink(fieldNum(CustRORReturnNoteSalesLink, OrigSalesId),
                                        element.args().record(),
                                        fieldNum(SalesTable, SalesId));
    }
    else
    if (element.args().dataset() == tableNum(smmBusRelTable))
    {
        this.query().dataSourceTable(tableNum(CustRORReturnNoteJour)).clearDynalinks();

        queryDataSourceLink = this.query().dataSourceTable(tableNum(CustRORReturnNoteJour)).addDataSource(tableNum(CustTable));
        queryDataSourceLink.addLink(fieldNum(CustRORReturnNoteJour, OrderAccount), fieldNum(CustTable, AccountNum));
        queryDataSourceLink.addDynalink(fieldNum(CustTable, Party),
                                        element.args().record(),
                                        fieldNum(smmBusRelTable, Party));
    }
}

void clicked()
{
    CustRORReturnNoteJour custRORReturnNoteJourLocal;

    for (custRORReturnNoteJourLocal = getFirstSelection(CustRORReturnNoteJour_ds);
         custRORReturnNoteJourLocal;
         custRORReturnNoteJourLocal = CustRORReturnNoteJour_ds.getNext())
    {
        if (custRORReturnNoteJourLocal.canXMLBeSent())
        {
            custRORReturnNoteJourLocal.sendElectronically(PrintCopyOriginal::Original);
        }
        else
        {
            warning (strFmt("@SYS99017", custRORReturnNoteJourLocal.ReturnNoteId));
        }
    }

    super();
}

